import Days from './components/Day';
import './App.css';

function App() {
  let Current_Weather = [
    { 
    day : "Monday",
    Weather : "Sunny"
    } ,
    { 
    day : "Tuesday",
    Weather : "Cloudy"
    } ,
    { 
    day : "Wednesday",
    Weather : "Rainy"
    } ,
]
  return (
    <div className="App">
     <h1>Whether Prediction App</h1>
     <Days
     day = {Current_Weather[0].day}
     weather = {Current_Weather[0].Weather}></Days>
     <Days
     day = {Current_Weather[1].day}
     weather = {Current_Weather[1].Weather} ></Days>
     <Days day = {Current_Weather[2].day}
     weather = {Current_Weather[2].Weather}></Days>
    </div>
  );
}

export default App;
